import { GlobalConfig } from "../config";
import { TestClient } from "./client";

const client = new TestClient({
    host: GlobalConfig.BIND_ADDRESS,
    port: GlobalConfig.PORT,
});
client.connect();

const cipherSpec =
    "0432010102d3010302e0010501030104e20505023202af05050502110439030302a8043e03042d0504e600";
const payload =
    "";
const nextPayload =
    "";

const sendMessage = (s: string) => {
    const hexCodes = [] as string[];
    for (let i = 0; i < s.length; i += 2) {
        hexCodes.push(`${s.at(i)}${s.at(i + 1)}`);
    }

    const bytes = hexCodes.map((hex) => parseInt(`0x${hex}`, 16));
    client.write(Buffer.from(bytes));
};

sendMessage(cipherSpec);
setTimeout(() => sendMessage(payload), 5000);
setTimeout(() => sendMessage(nextPayload), 5000);
